import React from "react";
import { Container } from "react-bootstrap";

const Footer = () => {
  return (
    <>
      <Container
        className="services-section mt-5 pt-5"
        style={{ bakgroundColor: "#7F7EC7" }}
      >
        <h1>Footer</h1>
      </Container>
    </>
  );
};

export default Footer;
